import { ButtonToolbar } from 'react-bootstrap'
import CoursesFilterOption from './CoursesFilterOption'

const CoursesFilterCard = () => {

    const csCourses = ["Algebra1", "Intro To CS", "Design Of Alogrithms"]


    return (
        <>
            <ButtonToolbar>
                {csCourses.map((course) => (
                    <CoursesFilterOption text={course}/>
                ))}
            </ButtonToolbar>
        </>
    )
}

export default CoursesFilterCard
